import React, { useState } from 'react';
import { Route } from 'react-router';

const Login = () => {
    const [email, setEmail] = useState("");
    const [password, setPassword] = useState("");
    const [allEntry, setAllEntry] = useState([]);

    const SubmitForm = (e) => {
        const newEntry = { id: new Date().getTime.toString(), email: email, password: password };
        setAllEntry([...allEntry, newEntry]);
        console.log(allEntry);
        setEmail("");
        setPassword("");
    }

    return (
        <>
            <div clasName="container-fluid nav_bg">
                <div className="row">
                    <div className="col-10 mx-auto">

                        <form action="" onSubmit={SubmitForm}>
                            <div class="mb-3">
                                <label for="exampleInputEmail1" class="form-label">Email address</label>
                                <input type="email" class="form-control" id="email" name="email" aria-describedby="emailHelp" onChange={(e) => setEmail(e.target.value)} />
                                <div id="emailHelp" class="form-text">We'll never share your email with anyone else.</div>
                            </div>
                            <div class="mb-3">
                                <label for="exampleInputPassword1" class="form-label">Password</label>
                                <input type="password" class="form-control" id="password" name="password" onChange={(e) => setPassword(e.target.value)} />
                            </div>


                            <button type="submit" class="btn btn-primary">Submit</button>
                        </form>

                    </div>
                </div>
            </div>
        </>
    );
};

export default Login;
